ムカデキンチョールN 300ml<br>ブランド：キンチョール<br>販売・製造元：大日本除虫菊<br><br>ムカデ、ヤスデ、ゲジゲジの駆除に適した殺虫剤です。<br>害虫への直接噴射で殺虫効力を発揮します。<br>害虫の生息場所や侵入ルートへの噴霧塗布により待ち伏せ効果が約4時間持続します。<br>(使用環境・条件により異なります。<br>)噴霧塗布面に害虫が接触するだけで殺虫効果があります。<br>低臭性。<br>屋内・屋外兼用。<br> <br>適用害虫ムカデ、ヤスデ、ゲジゲジ <br><br>使用方法<br>●直接噴射害虫をみかけたら、20-30cmの距離から直接噴射してください。<br>●噴霧塗布害虫の生息場所や家屋の周囲などに、20-30cmの距離から、約10cmの幅で1mあたり約5秒、噴霧塗布してください。<br> <br><br>使用上の注意<br>●使用に際しての注意(1)定められた<br><br>使用方法<br>を必ず守ってください。<br>(2)皮膚、飲食物、食器、おもちゃ、ペット類(観賞魚、小鳥など)、植物、飼料にはかからないようにしてください。<br>(3)人体用ではありませんので人体には使用しないでください。<br>(4)アレルギー体質やかぶれなどを起こしやすい体質の人、喘息の症状がある人は薬剤を吸い込んだり、触れたりしないでください。<br>(5)投げたり、落としたりせず、丁寧にお使いください。<br>(6)ムカデを駆除する場合は、身体の露出部をできるだけ少なくするなど、刺されないよう十分注意してください。<br>(7)プラスチック面、ニスなどの塗装面、白木、白壁、床などに使用する際には、予め目立たない場所に噴射して、影響がないことを確かめた後、使用してください。<br>(8)家具(桐のタンスなど高級家具)、建具、カーテンなどの繊維製品、大理石や御影石などの石材、しっくい、自動車などの塗装面に薬剤が付着した場合、変色、変形することがあるので、かからないように注意してください。<br>万一かかった場合は、直ぐに乾いた柔らかい布で拭き取ってください。<br>(9)本剤使用後、乾くまでの間は滑りやすくなっていますので、ご注意ください。<br>(10)室内に湯沸器やタバコなどの火気のないことを確認してください。<br>(11)魚に対して毒性があるので金魚鉢や水槽、池などに噴霧粒子が入らないように注意してください。<br>●使用中、使用後の注意(1)室内で使用する場合は、噴射中、噴射する人以外の入室を避け、噴射後室内の空気を外気と交換した後、入室してください。<br>又、噴射気体を直接吸入しないでください。<br>(2)90秒以上連続噴射しないでください。<br>(3)皮膚に付いたときは、石鹸と水でよく洗ってください。<br>(4)万一、身体に異常を来した場合や、誤って薬剤を飲み込んだ場合は、直ちに使用を中止し、本剤がピレスロイド系の殺虫剤であることを医師に告げて診療を受けてください。<br>(5)目に入らないように注意してください。<br>万一、誤って入った場合は直ちに水でよく洗い、異常があれば眼科医の手当てを受けてください。<br>(6)噴霧塗布面に雨や水がかかると効果が減少します。<br>その場合は再度、噴霧塗布をしてください。<br>(7)炎(火源)に向かって噴射しないでください。<br> 保管上の注意(1)小児の手の届かない場所に保管してください。<br>(2)火気を避け、なるべく冷所で保管してください。<br>(3)水回りや湿気の多い場所に置くと缶が錆びて破裂する危険があるので置かないでください。<br>(4)直射日光の当たる所、夏場の車内、ファンヒーターなどの暖房器具や加熱源の周囲は温度が上がり破裂する危険があるので置かないでください。<br> 廃棄上の注意ゴミとして出すときは、火気のない通気性のある屋外でガス抜きキャップを利用するか、噴射音が消えるまでボタンを押してガスを抜き、地域の規則に従って出してください。<br> <br>成分<br>有効成分：ピレスロイド(d-T80-フタルスリン、シフルトリン) 火気と高温に注意高圧ガスを使用した可燃性の製品であり、危険なため、下記の注意を守ること。<br>(1)炎や火気の近くで使用しないこと。<br>(2)火気を使用している室内で大量に使用しないこと。<br>(3)高温にすると破裂の危険があるため、直射日光の当たる所や火気等の近くなど温度が40度以上となる所に置かないこと。<br>(4)火の中に入れないこと。<br>(5)使い切って捨てること。<br>高圧ガス：LPG、DME <br><br>お問い合わせ先<br>大日本除虫菊株式会社〒550-0001 大阪市西区土佐堀1-4-11お客様相談室：06-6441-1105受付時間：9：00-17：00(土・日・祝日を除く) <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺虫剤 ムカデ用<br>JANコード： 4987115522275<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
